  const [formData, setFormData] = useState(new FormData());

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await fetch(
        "https://localhost:8443/onlineexam/control/ExammasterEntity",
        {
          method: "POST",
          body: formData,
          mode: "no-cors",
        }
      );

      if (!response.ok) {
        throw new Error("Network response was not ok");
