              <label htmlFor="" class="label1">NoOfQuestions</label>
              <input type="text" id="" class="form-control finput" placeholder="No of questions" name="" />
            </div>
        
          
            <div className="form-group div2">
              <label htmlFor="" class="label1">Durationminutes</label>
              <input
                type="text"
                id=""
                placeholder="Duration Minutes eg(60-Minutes)"
                name=""
                class="form-control finput"
              />
            </div>
            <div className="form-group div2">
              <label htmlFor="" class="label1">Passpercentage</label>
              <input
                type="text"
                id=""
                placeholder="pass-percentage eg(25%)"
                name=""
                class="form-control finput"
